import React from "react";

const header = () => {
    return (
        <nav class="navbar navbar-light bg-light">
            <form class="form-inline">
                <input
                    class="form-control mr-sm-2"
                    type="search"
                    placeholder="Search"
                    aria-label="Search"
                />
                <button
                    class="btn btn-outline-success my-2 my-sm-0"
                    type="submit"
                >
                    Search
                </button>
            </form>
        </nav>
    );
};

export default header;
